// this line should not be removed
var wModernLayout = angular.module( "wModernLayoutGood",[]);

wModernLayout.controller( "wModernLayoutGoodController", function( $scope ) {


    //---------------------- Beginning of use case data section --------------------------
    $scope.candidates = [
        {"name": "John Kelly", "bio": "Self taught programmer, very dedicated and pragmatic, take charge and focused. Well rounded personality with a balanced look on things and ways to solve problems",
        "photo": "/resources/Examples/images/john_williams.jpg",
        "contact": {"facebook":"john_kelly", "twitter":"","linkedin":"john_kelly@linkedin","skype":"john_kelly@skype"},
        "skills": {"soft": 3, "technical": 4, "presentation":5},
        "interview": {"manager": 90, "peer":80, "HR":75}
        },
        {"name": "Samantha Dull", "bio": "Top programmer, gratduated with honors, developped games since the age of 12, waiting for the right opportunity to start my own business",
        "photo": "/resources/Examples/images/paula_gates.jpg",
        "contact": {"facebook":"samantha_dull", "twitter":"@samantha_dull","linkedin":"samantha_dull@linkedin","skype":""},
        "skills": {"soft": 5, "technical": 1, "presentation":2},
        "interview": {"manager": 80, "peer":90, "HR":95}
        },    
        {"name": "William Lang", "bio": "Expert in demistifying technology for non technical people. Always focused in making programming accessible to themasses thru the building of self taught online courses.",
        "photo": "/resources/Examples/images/james_king.jpg",
        "contact": {"facebook":"william_lang", "twitter":"@william_lang","linkedin":"william_lang@linkedin","skype":"william_lang@skype"},
        "skills": {"soft": 4, "technical": 3, "presentation":4},
        "interview": {"manager": 95, "peer":70, "HR":80}
        } 
    ];

    $scope.messages = [
    {
        title: "You are a winner!",
        content: "<i class='fa fa-thumbs-up'></i><b>   " + "</b>You have made it<p>check the power of <a href='http://www.interactive-clouds.com' target='_blank'>DreamFace</a></p>",
        color: "#69c46a",
        icon: "fa fa-users fadeInRight animated",
        iconSmall: "fa fa-user fa-4x fadeInRight animated",
        timeout: 4000
    },

    {
        title: "Warning",
        content: "<i class='fa fa-flag'></i><b>   sending the candidate an email alerting them of the request for an interview</i>",
        color: "#c09853",
        icon: "fa fa-send-o fadeInRight animated",
        iconSmall: "",
        timeout: 4000
    }
    ];
    //---------------------- End of use case data section --------------------------

    //---------------------- This code is executed the first time the widget is created --------------------------
    //Display first item in the array
    $scope.currentIndex = 0
    $scope.selCandidate = $scope.candidates[$scope.currentIndex];




    //-------------- Change the index of the "card" to be shown" and apply it to the "model structure" used by the GC
    $scope.navigate = function(arg) {

        $scope.currentIndex = $scope.currentIndex + arg;

        if ($scope.currentIndex < 0) {
            $scope.currentIndex = $scope.candidates.length - 1;
        } else if ($scope.currentIndex >= $scope.candidates.length) {
            $scope.currentIndex = 0 ;
        }

        $scope.selCandidate = $scope.candidates[$scope.currentIndex]; 

        return '';
    };    

    $scope.fancyAlert = function(smallOrBig, aMessage) { 
        if (smallOrBig =="S") {
            $.smallBox (aMessage);           
        } else {
            $.bigBox (aMessage);            
        }
    };


});

